import React from 'react';

const Login = () => {
        return (
            <div>
                <form action="{{ url_for('login_bp.login') }}" method="post">
                    <div>
                        <label htmlFor="user_id">아이디</label>
                        <input type="text" name="user_id" id="user_id" placeholder="아이디 입력" />
                    </div>
                    <div>
                        <label htmlFor="password">비밀번호</label>
                        <input name="password" type="password" placeholder="비밀번호 입력" />
                    </div>
                    <input type="submit" value="로그인" />
                    <a class="nav-link" href={() => history.push("/register")}>회원가입</a>
                </form>
            </div>
        );
}

export default Login;
